// courseData.js
import awsImage from '../assets/event_01.png';
import sparkImage from '../assets/event_02.png';
import pythonImage from '../assets/event_03.png';

export const courseData = [
  { title: "[웹개발/고급] 스프링부트 이용자를 위한 클라우드 입문(AWS, Docker)", image: awsImage, price: "25,300원", videoId: "oq1bttg9VhM" },
  { title: "[데이터/고급] Spark과 SparkML을 이용한 모델 훈련", image: sparkImage, price: "29,700원", videoId: "다른_영상_ID_1" },
  { title: "[IT일반/중급] Python 기초 실습 코스", image: pythonImage, price: "55,000원", videoId: "다른_영상_ID_2" },
];
